import { ApiProperty } from '@nestjs/swagger';

export class CreateMagazineDto {
  @ApiProperty({ description: 'Name of the magazine', example: 'The Hindu' })
  name: string;
  @ApiProperty({
    description: 'Image for the magazine',
    example: `data:image/webp;base64,`,
  })
  image: string;
  @ApiProperty({
    description: 'price of the magazine',
    example: 200,
  })
  price: number;
  @ApiProperty({
    description: 'Created date of magazine',
    example: new Date(),
  })
  createdAt: Date;
  @ApiProperty({
    description: 'Updated date of magazine',
    example: new Date(),
  })
  updatedAt: Date;
  @ApiProperty({
    description: 'Deleted date of magazine',
    example: new Date(),
  })
  deletedAt: Date;
}
